INSERT INTO `dokumen` (`id_dokumen`, `isi_dokumen`) VALUES
(1, 'Alonso Geram Gagal Lanjutkan Balapan\r\n\r\nJawaPos.com - Pembalap McLaren, Fernando Alonso, geram gagal melanjutkan balapan di GP Australia, Minggu (26/3). Sebab, ini karena banyaknya adangan yang menghampirinya.\r\n\r\nMemang, Alonso sebelumnya harus tersingkir. Ini karena mobilnya mengalami kendala karena kerusakan suspensi.\r\n\r\nPadahal, dia sempat ada di posisi kesepuluh. Balapan juga tinggal sisakan tujuh lap lagi.\r\n\r\n"Jelas sangat kecewa. Saya sempat mengira ini jadi yang terbaik, tapi kerusakan itu mengubah semuanya," ujar Alonso dikutip dari Planet F1.\r\n\r\nMenurut Alonso, mobilnya memang sudah terasa tak enak di awal. Pembalap 35 tahun ini menjabarkan alasannya.\r\n\r\n"Kami kurang persiapan yang cukup. Saya pikir kami harus melepas pedal gas selama satu detik tiap putaran. Dan meski tantangan seperti itu, kami sempat berada di posisi poin," papar dia.\r\n\r\nHal ini bikin pembalap Spanyol itu pesimistis. Karena mobilnya dianggap kurang kompetitif.\r\n\r\n"Saat kualifikasi posisi 13, dan ada di posisi poin. Saya kira akan sulit diulangi balapan seperti ini," tandas dia. (ies/JPG)\r\n'),
(2, 'Ariel Noah Takjub Dengan Animo Bulu Tangkis di Surabaya\nJawaPos.com - Vokalis grup band Noah, Ariel, memuji animo penonton Djarum Superliga Badminton 2017 yang hadir di DBL Arena, Surabaya. Menurut Ariel, keriuhan penonton di turnamen ini bertambah ramai dari tahun ke tahun.\nAriel menjadi tamu istimewa di DBL Arena pada Jumat (24/2) malam ini. Ariel terbang ke Kota Pahlawan untuk mendukung Musica Champions yang bertanding di babak semifinal kontra Berkat Abadi Banjarmasin.\nAriel memberi kesan positif dari kedatangannya ke DBL Arena. "Ini kali ketiga saya bisa datang ke Superliga. Pertama di Surabaya, lalu Bali dan sekarang di Surabaya lagi. Ajang ini sangat bagus. Dan penontonnya semakin ramai," ucap Ariel kepada awak media.\nSelain ingin menyaksikan sepak terjang para pemain Musica, Ariel membawa misi khusus ke Surabaya. "Mudah-mudahan dengan saya hadir di sini ada sedikit menambah gemanya turnamen ini," harap ayah satu putri itu.\n"Keseruan yang terjadi di Indonesia itu kayaknya tidak banyak di musik dan olahraga. Apalagi badminton pernah bawa nama negara kita bagus banget. Jadi harus dijaga. Inginnya sih lebih semarak lagi," imbuh Ariel.\nIa lalu bercerita tentang awal mula berkenalan dengan bulu tangkis. Sejak kecil olahaga ini tak asing untuknya. Apalagi kedua orang tuanya juga hobi bermain bulu tangkis.\n"Papa dan mama dari dulu olahraganya itu (bulu tangkis). Mungkin yang paling gampang untuk dilakukan. Karena tidak perlu lapangan gede dan segala macamnya," tutup Ariel. (saf/JPG)\n\n'),
(3, 'Bangganya Merah Putih Terpampang di Motor Juara MotoGP Qatar\r\n\r\nJawaPos.com - Saat motor Yamaha YZR-M1 tunggangan Maverick Vinales dan Valentino Rossi menyentuh garis finis di urutan pertama dan ketiga pada MotoGP Qatar, Senin (27/3) dini hari, Indonesia ikut bangga. Bagaimana tidak, di motor keduanya terpampang jelas logo bendera Merah Putih, yang menjadi simbol negara Indonesia di pentas dunia.\r\n\r\nMeski hanya berupa logo kecil Merah Putih di bagian depan motor, jelas tetap menjadi kebanggaan yang luar biasa bagi Indonesia. Setidaknya ini menjadi pembuka jelang rencana Indonesia kembali menggelar salah satu seri MotoGP pada tahun depan. Vinales dan Rossi mampu menguasai podium di tempat pertama dan ketiga di Sirkuit Losail.\r\n\r\nSebelum bendera Merah Putih terpasang di motor YZR-M1, tagline berbahasa Indonesia “Semakin di Depan” dan kunjungan rutin tiap tahun Rossi, Jorge Lorenzo (mantan pembalap Yamaha), hingga Vinales, ke Indonesia, sudah mendekatkan penggemar MotoGP dengan Yamaha.\r\nMaverick Vinales dan Valentino Rossi di podium MotoGP Qatar.\r\n”Terpampangnya bendera Indonesia merupakan kebanggaan bagi orang Indonesia. Indonesia semakin dikenal dunia karena dipasang pada motor tercepat Yamaha di dunia. Dan ini membuat masyarakat dunia lebih mengenal Indonesia, setelah sebelumnya tagline Semakin di Depan sudah duluan terpasang,” papar M. Abidin, GM Aftersales & Public Relation PT Yamaha Indonesia Motor Manufacturing (YIMM), dilansir Ototrend.  \r\n\r\n"Ini juga bentuk penghargaan untuk fans tim Movistar Yamaha MotoGP, fans Valentino Rossi dan Maverick Vinales di Indonesia yang terkenal fanatik dan sangat menyukai MotoGP," imbuhnya. \r\n\r\nLebih lanjut, pembalap Yamaha Indonesia turut menanggapi munculnya bendera Merah Putih tersebut sebagai inspirasi meraih juara. Seperti Galang Hendra, Imanuel Pratna, Rey Ratukore yang beraksi dengan YZF-R25 di Asia Road Racing Championship (ARRC) kelas Asia Production 250 (AP250). \r\n\r\n”Bangga rasanya melihat bendera Merah Putih terpasang di M1. Sebagai seorang rider yang juga membawa nama negara di ajang balap, ini jadi penyemangat saya untuk ikut mengharumkan Indonesia. Makin semangat dengan hasil di Qatar podium pertama Maverick Vinales dan Valentino Rossi ketiga,” ucap Galang Hendra. \r\n\r\nImanuel Pratna turut mengamini, ”Ini sangat luar biasa buat bangsa Indonesia. Saya sendiri pun ikut merasakan bangganya jadi orang Indonesia bisa dilatih rider kelas dunia Valentino Rossi di Master Camp, karena ikut memperkenalkan negeri ini. Dan selamat buat Maverick Vinales dan Valentino Rossi untuk hasil bagus di Qatar". \r\n\r\nSementara, Rey Ratukore berharap kelak bisa lebih mengharumkan Indonesia dengan mengibarkan bendera Merah Putih di podium MotoGP. ”Saya sangat senang melihat bendera Indonesia ada di M1. Sebagai duta bangsa melalui kompetisi balap, tentunya ini jadi inspirasi istimewa yang membuat saya ingin membanggakan Indonesia dengan mengibarkan bendera Merah Putih di podium. Seperti di podium Qatar untuk Maverick Vinales dan Valentino Rossi," sebut dia.\r\n'),
(4, 'Carrick Pantas Berada di Man United 1 Tahun Lagi\r\nMichael Carrick memang jadi salah satu pemain paling senior di Manchester United saat ini. Dia berada di tim sejak 2006 dan kini telah berusia 35 tahun.\r\nSang pemain telah meraih dua titel Premier League bersama Setan Merah. Carrick musim ini memiliki peran berbeda. Dia tak lagi jadi yang utama karena Paul Pogba dan Ander Herrera selalu diprioritaskan.\r\n\r\nMeski begitu, legenda tim, Bryan Robson, mengaku bahwa Man United harus memberikan kontrak baru bagi Carrick. Pasalnya, meski sudah berumur, pengaruhnya ke dalam tim masih sangat besar.\r\n\r\n"Carrick sudah 35 tahun. Tapi bagi saya cara dia bermain musim ini dan pengaruh yang diberikan kepada tim, benar-benar luar biasa," jelasnya kepada Omnisport.\r\n\r\n"Sejujurnya saya tak terlalu peduli soal usia. Semua tentang hasrat seorang pemain dan bagaimana cara dia memandang dirinya sendiri. Carrick pantas berada di Man United satu tahun lagi. Saya juga yakin Man United mau memberikan kesempatan itu," tambah dia.\r\n\r\nSepanjang musim ini, Carrick memang hanya tampil 12 kali sebagai starter di liga. Bahkan pada awal bulan dia sempat membuka peluang pensiun dari dunia sepak bola.\r\n\r\n\r\n\r\n'),
(5, 'Djarum Kudus Takluk dari Klub Jepang Meski Diperkuat Ma Jin\r\nJawaPos.com - PB Djarum Kudus secara mengejutkan kalah dari klub asal Jepang, Kumamoto Saishunkan, di Djarum Superliga Badminton 2017. Meski diperkuat Ma Jin, Djarum Kudus kalah 1-4, Minggu (18/2) sore. Hasil ini di luar dugaan mengingat ma Jin merupakan bintang bulu tangkis dunia.\r\nSaishunkan membuka pertandingan dengan manis. Mereka merebut nomor tunggal pertama setelah Ayumi Mine mengalahkan Dinar Dyah Ayustine dua set langsung 21-19 dan 21-19.\r\nAkan tetapi, game kedua menjadi milik Djarum Kudus. Djarum menyamakan skor menjadi 1-1 setelah pasangan Ririn Amelia/Rosyita Eka Putri Sari mengalahkan pasangan Nami Matsuyama/Chiharu Shina dengan 21-17 dan 21-19.\r\nSaishunkan berbalik unggul 2-1 di game ketiga. Kali ini giliran tunggal kedua Yukino Nakai yang menyumbangkan poin. Nakai menaklukkan Desandha Vegarani Putri dua set langsung 21-12 dan 21-11.\r\nKejutan terjadi di game keempat. Ganda kedua Saishunkan yakni Riko Imai/Nao Ono menang tiga set dari bintang dunia Ma Jin/Gloria Emanuelle Widjadja dengan skor 19-21, 21-8 dan 21-19. Saishunkan memberkesar keunggulan menjadi 3-1.\r\nPada pertandingan pamungkas, Nami Matsuyama mengalahkan Ghaida Nurul Ghaniyu dengan skor 12-21, 22-20 dan 21-16. Skor akhir Saishunkan menang 4-1 atas Djarum Kudus.\r\n"Kalau mencari alasan menang atau kalah, pasti ada banyak alasan. Apapun hasilnya, kami sudah berjuang maksimal," ucap Ma Jin selepas pertandingan.\r\nKomunikasi menjadi salah satu penyebab kekalahan Ma Jin/Gloria. Apalagi keduanya baru pertama kali dipasangkan. "Masalah komunikasi tentu saja jadi masalah. Apalagi saya kurang mahir berbahasa Inggris. Sedangkan Gloria juga tidak bisa Bahasa Mandarin," ulas pemain yang sudah pensiun dari Timnas Tiongkok ini.\r\nManajemen Djarum Kudus kecewa dengan kekalahan di hari pertama. "Kami terus terang buta dengan kekuatan lawan. Ini suatu awal yang kurang baik. Tapi, kami memaklumi keadaan pemain kami. Ini adalah susunan terbaik dim kami," ujar Fung Permadi, manajer Djarum Kudus. (saf/JPG)\r\n\r\n\r\n\r\n'),
(6, '\r\nErlangga Kembali Pimpin KONI Jatim Secara Aklamasi\r\nJawaPos.com - Erlangga Satriagung terpilih secara aklamasi sebagai Ketua Umum KONI Jawa Timur (Jatim) periode 2016-2021. Hampir 100 persen pemilik suara sepakat menunjuk Erlangga untuk meneruskan tugasnya sebagai nahkoda KONI Jatim.\r\nErlangga menyandang status petahana saat maju dalam bursa Ketua Umum KONI Jatim. Dalam Musyawarah Olahraga Provinsi (Musorprov) di Hotel Garden Palace Surabaya, Selasa (14/3) sore, Erlangga mendapat dukungan dari 38 KONI Kota/Kabupaten dan 47 Pengprov.\r\nMantan Ketua REI Jatim ini menyisihkan dua pesaingnya, yakni Anton Setiadji dan Marzuki Rofi''i yang tidak mendapatkan satu pun suara dari voters. Sedangkan satu calon lain, yakni La Nyalla Mahmud Mattalitti memutuskan untuk mundur dari bursa pencalonan.\r\nDalam keterangannya kepada wartawan, Erlangga berencana merampingkan komposisi pengurus KONI Jatim. Pada periode sebelumnya, ada 116 orang yang terdaftar sebagai pengurus KONI Jatim. Menurut Erlangga, yang harus diutamakan adalah pelayanan kepada cabang olahraga.\r\n"Kami akan melakukan perampingan, antara 25 hingga 40 persen. Tidak usah terlalu ramping. Sebab Jatim handle cabang olahraga yang banyak," kata Erlangga.\r\nSementara itu, Wakil Ketua KONI Pusat, Suwarno memberikan ucapan selamat kepada Erlangga. Menurut Suwarno, Erlangga memiliki tugas berat untuk mempertahankan prestasi Jatim agar tetap berada di puncak.\r\n"Jawa Timur selalu di atas dari PON ke PON, banyak atlet Jawa Timur yang di Pelatnas. Mempertahankan prestasi itu tidak mudah. Sehingga itu menjadi tantangan tersendiri bagi Pak Erlangga ke depan supaya Jawa Timur tetap di atas," tutur Suwarno. (saf/JPG)\r\n'),
(7, 'Ferguson: Saya Gelisah Saat Man United Hadapi Liverpool\r\nSir Alex Ferguson sudah menjadi ikon Manchester United di era modern. Dia bahkan dianggap manajer terbaik tim sepanjang masa. \r\nMelatih tim selama 26 setengah tahun, Ferguson memberikan 13 titel Premier League untuk Setan Merah sebelum akhirnya pensiun. Semenjak Fergie pensiun, Man United belum sekalipun meraih titel liga kembali.\r\n\r\nMeski begitu, Fergie beberapa kali terlihat menonton langsung Man United di tribun eksklusif sebagai direktur. Memiliki hubungan yang sangat kental, Ferguson pun mengungkap perasaannya saat menonton tim.\r\n\r\n"Kegelisahan saya muncul ketika Man United melawan Liverpool dan Manchester City. Karena mereka berdua adalah tim besar dan juga rival utama tim," ujarnnya kepada Express.\r\n\r\n"Hal yang selalu muncul di sepak bola Inggris adalah Tribal. Anda punya klub-klub London, klub bagian tengah, dan Yorkshire. Hal ini menciptakan sesuatu yang sangat kompetitif pada liga," tambah dia.\r\n\r\nMeski begitu, Ferguson menyadari hanya ada satu laga paling panas dan akan selalu seperti itu sepanjang sejarah.\r\n\r\n"Tak ada yang bisa sebanding dengan laga Man United melawan Liverpool. Memang Man City mulai bangkit saat ini dan punya kekuatan, sehingga laga melawan mereka juga sangat penting," pungkas dia.\r\n\r\n\r\n\r\n'),
(8, 'Incaran Chelsea Diketahui Ingin Bermain Bersama PSG\r\nPada musim ini, AS Monaco memang tampil luar biasa. Hal ini tak lain karena performa apik para pemain muda mereka yang begitu memikat perhatian. Tak hanya Kylian Mbappe, ada beberapa nama lain yang begitu memikat.\r\nSalah satunya adalah jangkar 22 tahun Tiemoue Bakayoko. Sang pemain dikabarkan menjadi rebutan Chelsea dan Manchester United. Bahkan nama pertama dikabarkan telah mendapat persetujuan untuk mendatangkannya.\r\n\r\nMenarik ketika kakak Bakayoko, Soualio Bakayoko, mengungkapkan rahasia menarik. Dia memastikan sang saudara punya keinginan khusus dalam karier.\r\n\r\n"Ketika masih muda, dia ingin sekali bergabung dengan PSG. Bakayoko selalu bermimpi menjadi bagian tim tersebut," ujarnya kepada RMC Sport.\r\n\r\n"Ketika saya berkata ''bayangkan ketika suatu hari Anda bergabung dengan PSG''. Dia berkata akan sangat senang. Dia tak punya alasan untuk menolaknya. Tapi, Bakayoko sadar dia punya waktu untuk itu. Ketika tawaran PSG datang, dia tak akan menolaknya," pungkas sang saudara.\r\n\r\nBakayoko menjadi salah satu pemain muda paling disorot. Masa depannya pun menarik untuk ditunggu karena dipastikan banyak klub besar akan bertarung mendapat tanda tangannya.\r\n\r\n'),
(9, 'Juara Berkat Bantuan Verstappen\r\n\r\nJawaPos.com - Pembalap Ferrari, Sebastian Vettel, berhasil membuka seri pembuka Formula 1 2017 dengan kemenangan di GP Australia, Minggu (26/3). Keberhasilan pembalap asal Jerman itu menempati podium pertama ternyata tak lepas dari bantuan pembalap Red Bull, Max Verstappen.\r\n\r\nTentunya itu cukup aneh dan sulit dimengerti. Maklum saja, Vettel dan Verstappen bukan rekan satu tim sehingga tak mungkin menjalankan team order. Selain itu, keduanya tak akur setelah pada balapan musim lalu beberapa kali terlibat perseteruan.\r\n\r\nPaling menyita perhatian saat balapan di F1 GP Meksiko yang berlangsung pada Minggu (30/10/2016). Dalam seri yang digelar di Autodromo Hermanos Rodriguez itu, Vettel dan Verstappen saling tuding. Vettel menyebut gaya membalap verstappen terlalu berbahaya. Sementara Verstappen melabeli Vettel sebagai pembalap frustrasi pada waktu itu.\r\n\r\nToh, andai melihat jalannya balapan di GP Australia, Minggu (26/3), Verstappen memang seolah "membantu" Vettel untuk tetap berada di depan. Dia seolah menghalangi Lewis Hamilton untuk melewatinya dan kemudian mengejar Vettel.\r\n\r\n"Saya sedikit mendapat keberuntungan dari Verstappen. Dia melakukan sesuatu yang memberi jalan bagi saya tetap di depan dalam beberapa lap sebelum akhirnya dia masuk ke pit stop. Balapan yang menyenangkan dan kami melakukannya sangat baik," sebut Vettel kepada Motorsport.com.\r\n\r\nSejak awal balapan, Hamilton memimpin dan diikuti Vettel di belakang. Verstappen sendiri berada di belakang Vettel bersama Valtteri Bottas, dan Kimi Raikkonen. Dalam perjalanannya, Verstappen berusaha untuk melewati pembalap lain dan menyusul Vettel.\r\n\r\n"Awal balapan sangat ketat. Saya tahu Verstappen akan melakukan manuver. Tapi, saya berusaha untuk tetap berada di depan dia," sebut Vettel.\r\n\r\nTitik balik terjadi setelah lap ke-17. Hamilton memutuskan untuk masuk ke pit stop lebih awal. Dia mengganti ban ultrasoft dengan soft. Hanya saja, saat kembali ke lintasan, dia justru tertinggal dari Vettel yang terus melaju. Tak hanya itu Hamilton juga berada di belakang beberapa pembalap lain, termasuk Verstappen.\r\n\r\nVettel lantas memutuskan masuk ke pit stop pada lap ke-24. Strategi pit stop Vettel berjalan sempurna. Saat masuk kembali ke lintasan, dia tetap berada di depan Verstappen, dan tentu saja Hamilton yang di belakangnya.\r\n\r\nVettel sendiri berada di posisi ketiga di belakang Bottas dan Raikkonen. Upaya Hamilton untuk merangsek ke depan dihalang-halangi oleh Verstappen. Dia sepertinya tak sudi dilewati oleh Hamilton. Hal tersebut membuat Hamilton berulang kali mengeluh dalam komunikasi radio tim.\r\n\r\nSaat Bottas dan Raikkonen masuk pit stop, Vettel beralih memimpin balapan dan terus melaju. Hamilton tetap tak bisa melewati Verstappen di depannya. Kondisi itu dimanfaatkan Vettel untuk terus memacu jet daratnya. Kemudian Verstappen memutuskan masuk pit stop sehingga Hamilton bisa berada di posisi kedua. Namun, Vettel telah menjauh dan tak bisa dibendung hingga finis. (epr/JPG)\r\n'),
(10, 'Kobe: Bakal Ada Wakil MVP di NBA musim Ini\r\nJawaPos.com - Persaingan untuk meraih gelar MVP musim reguler tahun ini di NBA memang sangat ketat. Dua calon terkuat peraih MVP adalah bintang Houston Rockets, James Harden, serta andalan Oklahoma City Thunder, Russell Westbrook.\r\nSangat sulit menilai kedua pemain mengetahui konsistensi dan superioritas mereka yang hampir selalu terlihat. Legenda Los Angeles Lakers, Kobe Bryant, mengaku kebingungan untuk memilih.\r\nDia bahkan memberi masukan kepada NBA bahwa harus ada penghargaan khusus untuk kedua terbaik di liga musim ini.\r\n"Mungkin saja kita melihat Wakil MVP pertama sepanjang sejarah pada tahun ini," jelas Kobe kepada Lakersnation.\r\nMemang ada saja waktu dimana seorang pemain yang dirasa paling pantas meraih MVP, malah gagal mendapatkannya. Kobe dan Shaquille O''Neal menjadi bukti nyata. Keduanya hanya sekali meraih MVP musim reguler. (rap/JPG)\r\n\r\n\r\n'),
(11, 'Marquez Ungkap Kesalahan Besar yang Dilakukan di Qatar\r\n\r\nJawaPos.com - Race pertama MotoGP 2017 di Qatar tak berjalan mulus bagi sang juara bertahan, Marc Marquez. Pembalap Repsol Honda itu gagal naik podium dan harus menerima kenyataan finis peringkat keempat.\r\n\r\nPembalap muda ini pun mengungkapkan bahwa masalah sudah terjadi saat race baru berjalan lima lap. Hal ini berkaitan akan pemilihan bannya.\r\n\r\n"Balap memang ditunda beberapa saat dan itu adalah putusan yang tepat. Tapi, ini juga membuat kebingungan bagi kami memakai ban apa. Apalagi temperatur menurun," ujarnya setelah race.\r\n\r\n"Saya memakai ban depan hard, walau semua penuh dengan keraguan. Orang Michelin mengatakan saya satu-satunya yang memakai ban hard. Kemudian saya memilih medium. Dan itulah kesalahan terbesarnya," tambah dia.\r\n\r\nMarquez mengaku dirinya tak punya banyak pilihan. Karena jika memaksakan memakan ban hard pilihannya ada dua. Yang sangat baik atau sangat buruk.\r\n\r\n"Setelah race, saya berpikir dengan ban hard peluang untuk menang muncul sampai akhir. Tapi, saya juga sadar dengan ban tersebut saya bisa crash walau akan kompetitif," tuturnya.\r\n\r\n"Jika Anda memiliki motor yang mudah, akan lebih mudah mencari ban yang tepat. Tapi, jika motor Anda punya keterbatasan dan tak membuat putusan tepat, Anda akan kehilangan banyak waktu," pungkas dia.\r\n\r\n\r\n'),
(12, 'Massa Sebenarnya Tak Berniat Kembali ke Lintasan Musim Ini\r\n\r\nJawaPos.com - Felipe Massa mengungkapkan sebuah fakta mengejutkan. Pembalap asal Brasil itu sebenarnya tak berniat kembali ke lintasan Formula 1 pada musim ini.\r\n\r\nEks pembalap Ferrari tersebut seperti diketahui sudah memutuskan pensiun begitu musim 2016 berakhir. Namun, dia menarik kembali putusannya dan menerima tawaran dari Williams untuk menjadi pembalap mereka mendampingi Lance Stroll pada musim ini.\r\n\r\nMassa memang mengaku belum ingin pensiun sepenuhnya. Dia berniat kembali lagi ke lintasan balap. Tapi, sebenarnya bukan musim ini, melainkan musim 2018 mendatang. Dia ingin sabbatical terlebih dahulu selama satu musim.\r\n\r\nHanya saja, pinangan dari Williams tak bisa dia tolak. Terlebih setelah pembalap andal mereka, Valtteri Bottas pindah ke Mercedes lantaran Nico Rosberg memutuskan pensiun.\r\n\r\n"Saya dengan cepat memutuskan kembali ke F1 karena saya memang tak bisa meninggalkan dunia ini. Saya masih memiliki mentalitas yang sama seperti tahun lalu," sebut Massa kepada Motorsport.com.\r\n\r\nMassa menambahkan, dia pun tetap akan membalap pada musim depan andai ada kesempatan yang baik. Artinya, ketika masih ada tim yang memercayainya, dia akan tetap menggeluti F1. Namun, ketika sudah tidak ada tim yang memercayainya, dia akan pensiun dari F1. (epr/JPG)\r\n'),
(13, 'Mengistirahatkan Pemain Secara Sengaja Adalah Hal Memalukan di NBA\r\nJawaPos.com - Belakangan ini pembicaraan yang cukup sering bergulir di kalangan pencinta NBA adalah tentang hak tim mengistirahatkan pemain. Memang banyak tim yang sengaja tak memainkan pemain andalan pada sebuah laga.\r\nHal ini dianggap merugikan banyak pihak. Bahkan komisioner, Adam Silver, menganggap ini adalah isu signifikan.\r\nPendapat senada juga keluar dari mulut point guard andalan Houston Rockets, Pat Beverley. Hal ini terjadi ketika Rockets mengalahkan Oklahoma City Thunder 137-125.\r\n"Saya pikir itu adalah omong kosong dan memalukan di level liga. Fans pantas mendapatkan sesuatu yang lebih baik. Saya tak peduli jika para pelatih meminta pemainnya beristirahat atau tidak. Tapi, jika pemain tak mau bermain berarti dia tak punya respek kepada pertandingan itu sendiri," ujarnya kepada ESPN.\r\n"Ada waktu saat saya tak bermain di NBA dan mencoba sekuat tenaga untuk tampil di sini. Sehingga mengistirahatkan saya akan menjadi sesuatu yang tak terhormat. Sesuatu yang tak menghormati jersey dan nama pemain yang bertengger di punggung kita," pungkas dia. (rap/JPG)\r\n'),
(14, 'Mourinho Ungkap Tujuan Sebenarnya Terbang ke Kroasia\r\nPada jeda Internasional pekan ini, ada sebuah kabar menarik yang membuat fans Manchester United cukup antusias. Manajer Jose Mourinho diketahui terbang ke Kroasia.\r\nDia menyaksikan laga Kroasia vs Ukraina. Tak ayal, Mourinho dikabarkan ingin melihat langsung salah satu target Setan Merah, yaitu pemain Internazionale Milan, Ivan Perisic.\r\n\r\nMeski begitu, Mourinho langsung angkat bicara soal ini. Dia mengaku sama sekali tak ada tugas untuk tim dan ke Kroasia hanya untuk bersantai.\r\n\r\n"Saya tak punya maksud tertentu, saya hanya datang (ke Kroasia) untuk menikmati waktu luang dan mengunjungi teman saya seperti Predrag Mijatovic dan Davor Suker," tegas Mourinho, diberitakan Goal.\r\n\r\n"Saya tahu semuanya percaya saya datang untuk melihat beberapa pemain, tapi dalam sepak bola saat ini Anda tak harus bepergian hanya untuk melihat beberapa pemain, saya mengenal mereka semua dengan baik. Saya datang sebagai orang yang ingin santai dan menikmati udara yang menyenangkan, tidak seperti hujan di Manchester," paparnya.\r\n\r\nPerisic menjadi salah satu pemain paling diincar. Tak hanya Man United, Liverpool dan Chelsea juga sempat dikabarkan tertarik untuk mendatangkannya.\r\n'),
(15, 'Oezil Akhirnya Bicara Soal Kondisi di Arsenal\r\nMasa depan playmaker Arsenal, Mesut Oezil, memang masih tanda tanya. Kontrak sang pemain habis pada akhir musim depan dan berada dalam kondisi kurang baik belakangan.\r\nDia dan Alexis Sanchez memang berada dalam masalah mengetahui keduanya dalam kondisi yang tak memadai. Khusus Oezil, ada kabar yang mengatakan masa depannya bergantung dengan bertahan atau tidaknya Arsene Wenger di tubuh klub.\r\n\r\nNasib Wenger sendiri masih tak jelas di Arsenal mengetahui banyak yang menyerangnya dan berharap dia mundur dari The Gunners.\r\n\r\n"Anda pikir Wenger berbicara kepada jurnalis sebelum berbicara langsung kepada saya? Saya tahu dia dengan cara yang berbeda," jelasnya kepada Die Welt.\r\n\r\nGooners pun harap-harap cemas dengan putusan yang akan diambil oleh Oezil. Dia merupakan pembelian termahal tim dan memiliki dampak besar kepada Arsenal sejak bergabung.\r\n\r\nMeski kadang tak konsisten, performa Oezil sangat memengaruhi filosofi permainan Arsenal. Oezil pun dipastikan tak sulit mencari tim baru, mengetahui kualitas kelas satunya, tim-tim besar pasti mengantri untuk mendapatkan tanda tangan pemain Jerman tersebut.\r\n\r\nMenarik menunggu putusan apa yang akhirnya nanti diambil oleh sang pemain. Apakah dia akan bertahan atau malah memutuskan angkat kaki.\r\n\r\n'),
(16, '\r\nPetarung UFC Tak Akan Berani Hadapi Mayweather\r\nJawaPos.com - Legenda hidup tinju dunia, Oscar De La Hoya, menilai tak akan ada petarung UFC yang berani menghadapi Floyd Mayweather. Sebab menurutnya, UFC tak akan mau ambil risiko karena bisa kehilangan pamor.\r\nBelakangan, salah seorang petarung UFC, Conor McGregor, memang dikabarkan bakal menghadapi Mayweather. Duel itu semakin nyata setelah Mayweather sendiri resmi kembali dari pensiun.\r\nBeberapa promotor-pun sudah siap mengadu dua petarung dari divisi berbeda tersebut.\r\nNamun demikian, hal ini diprediksi oleh De La Hoya, tak akan terjadi. Sebab, andai kalah UFC akan kehilangan pamor.\r\n"Sekarang begini, uang memang bisa jadi pertaruhan menggiurkan. Di atas kertas, Mayweather bisa menang, dan ini jadi bencana buat UFC," papar De la Hoya dikutip dari Boxing Scene.\r\nMantan petinju yang dijuluki The Golden Boy itu menyarankan Mayweather tak usah ladeni McGregor. Masih ada banyak lawan tanding yang lain.\r\n"Kembali bertarung buatnya cukup masuk akal. Lawan Canelo misalnya, itu akan jadi hal yang menarik," tandas dia. (ies/JPG)\r\n\r\n\r\n'),
(17, '\r\nRenault Revisi Target, Kejar Posisi 4 Klasemen Konstruktor\r\n\r\nNico Hulkenberg yakin Renault bisa berada di posisi 4 klasemen konstruktor (Motorsport.com)\r\nBerita Terkait\r\n\r\nJawaPos.com - Renault merevisi target pada balapan Formula 1 musim ini. Sebelumnya mereka menargetkan berada di posisi kelima klasemen akhir konstruktor. Namun, usai seri pertama di Australia, Renault yakin bisa berada di peringkat keempat.\r\n\r\nRenault yakin bisa bersaing dengan Williams, Force India, Toro Rosso, dan Haas untuk menduduki posisi keempat. Mereka pun realistis karena tiga besar bakal menjadi milik Mercedes, Ferrari, dan Red Bull.\r\n\r\n"Target kami awalnya berada di posisi kelima. Tapi, setelah seri pertama, kami yakin bisa lebih baik lagi. Kami menunjukkan performa lumayan dan kami kini berambisi bisa berada di posisi keempat," sebut pembalap Jolyon Palmer kepada Motorsport.com.\r\n\r\nAndai target itu sulit dicapai, Renault berharap bisa melampaui pencapaian musim lalu. Seperti diketahui, musim lalu renault hanya berada di posisi kelima klasemen konstruktor.\r\n\r\nSetali tiga uang, rekan Palmer, Nico Hulkenberg meyakini bahwa Renault akan mampu bersaing. Meski di seri pertama gagal mendapat poin, ke depan Hulkenberg yakin bisa meraih pencapaian yang lebih baik.\r\n\r\n"Kami mampu bersaing di Australia. Pada balapan berikutnya, kami akan membuktikan bahwa kami bisa meraih yang terbaik. Mobil kami lebih baik dibanding versi sebelumnya," beber Hulkenberg.\r\n\r\nDi GP Australia, Hulkenberg hanya berada di posisi ke-11 dan tanpa poin. Sementara Palmer lebih buruk karena gagal menyelesaikan balapan. (epr/JPG)\r\n'),
(18, 'Rossi Puji Debut Istimewa Zarco di MotoGP\r\n\r\nJawaPos.com - Pembalap Rookie Yamaha Tech3, Johann Zarco, memang sempat menjadi pembicaraan. Pada MotoGP pembuka di Qatar, dia sempat berada di posisi terdepan pada awal race.\r\n\r\nSayangnya, masalah terjadi pada kelokan kedua di beberapa lap awal. Tak ayal, sang pembalap harus tergelincir dan gagal finis.\r\n\r\nTerlepas dari kegagalan ini, Zarco memperlihatkan bahwa dia bisa bersaing dengan pembalap-pembalap senior lainnya. Tak ayal, pembalap Yamaha, Valentino Rossi, memuji sang pemain.\r\n\r\n"Saya penasaran dengan performanya di MotoGP karena Franco Morbidelli selalu berkata bahwa Zarco sangat spesial di Moto2 dan akan cepat di MotoGP," ujarnya kepada Autosport.\r\n\r\n"Tergelincirnya dia hanya sebuah kesalahan dari sosok yang belum berpengalaman dengan kondisi. Tapi, dia memperlihatkan performa yang hebat dan sangat kuat," tambah dia.\r\n\r\nRossi juga sedikit menganalisis tentang motor Tech3 yang ditunggangi Zarco musim ini.\r\n\r\n"Motor mereka mungkin terlalu mudah untuk ditunggangi dan berada di level yang tinggi. Yamaha punya motor MotoGP yang sangat hebat. Sebuah motor yang bersahabat untuk para pembalap. Tapi, dengan tekanan yang ada, mereka butuh waktu dan pengalaman," pungkas dia.\r\n'),
(19, 'Si Cantik Sharapova Berjuang Bangun Kepercayaan Diri\r\nJawaPos.com - Petenis cantik, Maria Sharapova, kini sedang berjuang untuk kembali membangun kepercayaan dirinya. Hal ini setelah dia bebas dalam hukuman suspensi akibat keterlibatan penggunaan doping.\r\nSebelumnya, lima kali juara Grand Slam ini memang dilarang dua tahun setelah positif memakai meldonium. Namun, pengadilan Abritrase Olahraga (CAS) mengurangi suspensinya.\r\nPetenis 29 tahun itu kini sudah terbebas dari sanksi. Kini, dia mulai membangun kepercayaan diri jelang tarung di Porsche Grand Prix bulan depan.\r\n"Apakah itu sulit? Tentu saja. Membangun kepercayaan di olahraga ini tak semudah membalikkan telapak tangan. Praktek tak akan pernah sama dengan rencana," ungkap Sharapova dikutip dari BBC Sport.\r\nSharapova sendiri terbebas dari masa hukuman pada 26 April kemarin. Selain di turnamen tadi, dia juga akan ikuti Grand Priz di Roma dan Madrid.\r\n"Ketika Anda mencintai apa yang dilakukan, semuanya pasti akan mendukung. Itu sudah hukum alam. Saya kini akan berlatih dan lebih kers lagi setelah empat bulan terakhir ini," tandas dia. (ies/JPG)\r\n\r\n\r\n'),
(20, 'Tampil di Semua Laga NBA Akan Pengaruhi MVP Menurut Harden\r\nJawaPos.com - Pada beberapa pekan terakhir, salah satu hal yang paling sering dibicarakan adalah tren tim-tim NBA yang senang mengistirahatkan para pemainnya.\r\nPro dan kontra muncul. Tapi, pendapat menarik datang dari salah satu calon MVP musim reguler tahun ini, James Harden, juga berbicara.\r\nHarden menjadi salah satu penampil dengan performa paling konsisten sepanjang musim. Superioritasnya terlihat, tak hanya dalam mencetak poin, tapi membantu rekan-rekannya memberikan performa terbaik.\r\nPemain berjanggut tebal itu juga belum sekalipun absen pada laga musim ini. Memperlihatkan kekuatan dan kondisi fisiknya yang sangat fit.\r\n"Ya, saya pikir bermain di semua laga musim reguler bisa memengaruhi pemilihan MVP. Karena Anda tak akan meninggalkan rekan Anda dalam kondisi kekeringan," ujarnya kepada ESPN.\r\n"Bagi saya, penting untuk selalu ada di belakang rekan-rekan setim dan selalu berada di lapangan. Saya tahu mereka akan selalu siap membantu dan juga sebaliknya," tambah dia.\r\nMenarik selain rataan kapasitas menyerangnya yang sangat luar biasa. Harden menjadi pemain kedua di laga dengan menit tertinggi yakni 2,666 menit hanya kalah dari Andrew Wiggins 2,681 menit. (rap/JPG)\r\n\r\n'),
(21, 'Vettel Mulai Berjodoh dengan Gina\r\n\r\nJawaPos.com - Sudah menjadi kebiasaan bagi pembalap Jerman, Sebastian Vettel untuk menamai mobil yang dikendarainya setiap musim di Formula 1. Tak terkecuali musim 2017, Vettel mulai menunjukkan tanda-tanda berjodoh dengan pasangan barunya, Gina.\r\n\r\nGina merupakan nama mobil terbaru Ferrari SFH70 yang memang dikendarai Vettel. Gina hanya satu dari sekian banyak nama yang pernah disematkan kepada mobil juara dunia empat kali ini. \r\n\r\nDia memang punya tradisi memberi nama mobilnya sejak awal kariernya pada 2008 ketika bergabung dengan Toro Rosso. Pada saat itu, dia memberi nama mobilnya “Julie”. Setelahnya, pembalap 29 tahun itu semakin ketagihan memberi nama mobilnya dengan berbagai fantasinya sendiri.\r\n\r\nPada 2009, tahun pertamanya bersama Red Bull, mobilnya dinamai “Kate” dan “Kate''s Dirty Sister”. Kemudian mobil juaranya yang pertama pada 2010, RB6, diberi nama “Luscious Liz” dan “Randy Mandy”. Disusul kemudian pada musim 2011, RB7 tunggangannya dia panggil “Kinky Kylie”.\r\n\r\nDominasinya berlanjut di musim berikutnya dengan Abbey (2012) dan “Hungry Heidi” pada 2013. Dengan Heidi inilah Vettel sukses mencatat rekor kemenangan seri sembilan kali tanpa putus dan merengkuh juara dunianya yang keempat. Kemudian dia menutup karirnya di Red Bull bersama “Suzie”. Di musim terakhirnya itu Suzie tak memberinya satupun kemenangan.\r\n\r\nSetelah hengkang ke Ferrari pada 2015, Vettel mulai kesulitan menemukan jodoh dengan nama mobilnya. Mobil pertamanya dia namai “Eva”. Bersama Eva dia meraih tiga kemenangan. Untuk menambah cita rasa Italia pada mobil Ferrarinya, Vettel menamai mobilnya tahun lalu dengan “Margherita” seperti sejenis piza. Pada musim lalu dia juga gagal merengkuh sekalipun kemenangan.\r\n\r\nTahun ini Gina dipilih sebagai nama tunggangannya. Berasal dari kata “Regina” yang berarti Ratu dalam bahasa Latin. Tampaknya, nama ini memberikan keberuntungan kepada Vettel. Tentu dengan nama ini Vettel punya mimpi menjadi Raja di akhir musim nanti. Tanda-tanda sudah terlihat saat Vettel dan Gina mampu finis pertama pada GP Australia, Minggu (26/3). Mungkinkah Gina menjadi jodoh terbaru Vettel untuk merengkuh titel juara dunia?  (cak/ira/JPG)\r\n'),
(22, 'Vinales Bisa Mengatasi Tekanan Perebutan Gelar Juara\r\n\r\nJawaPos.com - Pembalap anyar Yamaha, Maverick Vinales, memperlihatkan bahwa dia langsung bisa memperlihatkan performa terbaik. Pada MotoGP Qatar sebagai pembuka musim ini, sang pembalap langsung meraih gelar juara.\r\n\r\nTak ayal, mantan juara MotoGP, Kevin Schwantz, memberikan pujian khusus untuk sang pembalap belia itu. Menurutnya, Vinales sangat mampu mengatasi segala masalah sebagai pembalap unggulan.\r\n\r\n"Saya pikir Vinales cukup pintar dan tim juga membantunya tiap pekan untuk tampil konsisten karena tujuan mereka adalah gelar juara dunia," ujarnya kepada Motorsport.\r\n\r\n"Yamaha akan mengatakan bahwa Vinales hanya harus memberikan performa terbaik dan jika dia off pada sebuah race, tak akan ada tekanan berat yang datang. Selama mereka bisa membuat Vinales memanfaatkan kemampuannya, pun memiliki mentor, tak kaget jika dia mampu memperlihatkan penampilan yang baik," tambah dia.\r\n\r\nSchwantz memastikan bahwa banyak cobaan untuk pembalap saat ini, terutama mereka yang menjadi andalan sebuah pabrikan besar seperti Yamaha.\r\n\r\n"Akan menjadi pertarungan yang ketat ketika Anda memperkuat motor yang kompetitif dan tiap pekan berada bersama rekan yang juga berkualitas," pungkas dia.\r\n'),
(23, 'Vinales Sempat Cemaskan Manuver Rossi di MotoGP Qatar\r\n\r\nJawaPos.com - Maverick Vinales melakoni debut gemilang bersama tim barunya, Yamaha, di MotoGP Qatar, Senin (27/3) dini hari lalu. Pembalap asal Spanyol tersebut langsung juara pada debutnya bersama Yamaha.\r\n\r\nHanya saja, ada hal yang cukup mengejutkan diungkapkan Vinales. Dia mengaku sempat mencemaskan manuver yang dilakukan rekannya di Yamaha, Valentino Rossi. Dalam artian, dia khawatir dirinya dilewati oleh pembalap asal Italia tersebut.\r\n\r\nSeperti diketahui, Rossi cukup mengejutkan dalam balapan di Qatar. Start dari posisi ke-10, Rossi mampu melesat dan finis di posisi ketiga. Mungkin Rossi bisa melewati Andrea Dovizioso (Ducati) dan Vinales andai jumlah lap ditambah.\r\n\r\nItulah kekhawatiran yang dirasakan Vinales. Dia mengaku cemas Rossi akan mampu melewatinya. "Saya sangat terkejut dengan apa yang ditunjukkan Rossi. Saya tak boleh meremehkannya. Bukan karena dia rekan setim, melainkan dia masih memiliki kemampuan spesial dalam usianya saat ini," sebut Vinales seperti dilansir Motosport.com.\r\n\r\nImbuhnya, "Saya sempat berpikir dia tak akan bisa bersaing di tiga besar. Tapi, dia luar biasa. Saya sempat khawatir dia akan melewati saya. Namun, saya bisa fokus dan berhasil menjaga jarak dengan dia sampai akhir balapan".\r\n\r\nVinales pun tak lupa memuji performa Rossi. Dia meyakini musim ini akan terjadi persaingan menyenangkan antara dirinya dan Rossi.\r\n'),
(24, 'Warriors Ungkap Kondisi Terkini Cedera Kevin Durant\r\nJawaPos.com - Golden State Warriors memang tampil tanpa salah satu andalan, Kevin Durant, sejak akhir Februari lalu. Sang pemain mengalami cedera MCL dan bengkak tulang di bagian lutut.\r\nBelum ada yang tahu pasti kapan Durant bisa kembali membantu Warriors musim ini. Meski begitu, pelatih Steve Kerr akhirnya angkat bicara.\r\n"Durant masih melakukan integrasi dan konsultasi dengan staf latihan. Kami mungkin bisa memainkan dia dalam menit yang kecil agar dia bisa meningkatkan kondisi dan ritme permainan," ujarnya kepada Mercury News.\r\n"Tapi, yang ditakutkan adalah adanya efek domino pada rotasi. Ketika waktunya tiba, kami akan mencari jalan keluar. Lagipula Durant baru bisa tampil beberapa pekan ke depan," tambah dia.\r\nMenurut Kerr, paling cepat Durant bisa kembali dua pekan ke depan. Tapi, segala kemungkinan masih bisa terjadi. Durant diharapkan bisa kembali sebelum playoff.\r\nSeiring dengan cedera Durant, Warriors memang kembali mengandalkan Klay Thompson dan Stephen Curry sebagai pemasok poin utama. (rap/JPG)\r\n\r\n'),
(25, 'Westbrook Raih Triple-double ke-36, Thunder Tetap Takluk dari Rockets\r\nJawaPos.com - Russell Westbrook terus memperlihatkan konsistensi dengan permainan super apik sepanjang musim. Meski begitu, tak selalu permainan spesial Westbrook berbanding lurus dengan hasil yang digapai oleh Oklahoma City Thunder.\r\nPada laga ini Westbrook membuat triple-double ke-36 sepanjang musim dengan membuat 39 poin, 11 rebounds, 13 assists. Meski begitu tim kalah dari Houston Rockets 137-125.\r\nMenariknya Rockets tak terlalu mengandalkan James Harden pada laga ini. Sang pemain hanya membuat 22 poin ditambah 12 assists. Dia hanya ada di urutan keempat pemain Rockets dengan poin tertinggi.\r\nPasalnya Lou Williams berhasil membuat 31 poin, sementara Eric Gordon dan Trevor Ariza masing-masing mencatat 24 poin.\r\n"Harden sebenarnya bisa saja bermain sendiri dan membuat 40 poin. Dia hanya tinggal mengalirkan semua aliran yang datang kepadanya," ujar pelatih Rockets Mike D''Antoni setelah laga.\r\n"Tapi, dia tahu rekan-rekannya juga akan berjuang dan punya cara tersendiri untuk mencetak poin. Sehingga Harden memilih memainkan basket sesuai dengan yang seharusnya," pungkas dia. (rap/JPG)\r\n\r\n');
